import React, { useState } from 'react';
import { motion } from 'framer-motion';

// Define default values
const BOX_WIDTH = 200;
const BOX_HEIGHT = 200;

// Random position generation for each circle within the bounding box
function generateRandomPositionInBox(circles, size) {
  let top, left;
  const attempts = 100; // Limit the number of attempts to avoid infinite loop
  let validPosition = false;

  for (let attempt = 0; attempt < attempts; attempt++) {
    top = Math.floor(Math.random() * (BOX_HEIGHT - size));
    left = Math.floor(Math.random() * (BOX_WIDTH - size));

    // Check if the new circle position intersects with any existing circles
    validPosition = !circles.some(circle => {
      const distX = Math.abs(circle.left - left);
      const distY = Math.abs(circle.top - top);
      const combinedRadius = (circle.size + size) / 2;
      return distX < combinedRadius && distY < combinedRadius;
    });

    if (validPosition) break; // Found a valid position
  }

  return { top, left };
}

// Random scale generation for each circle (between 1 and 1.2 for subtle size variations)
function generateRandomScale() {
  return 1 + Math.random() * 0.5; // Random scale between 1 and 1.5
}

// Random wiggle values for animation
function generateRandomWiggle() {
  return Math.random() * 10 - 5; // Random wiggle value between -5 and 5
}

// Random size for each circle (between 60px and 160px for more spread)
function generateRandomSize() {
  return Math.floor(Math.random() * (160 - 60 + 1)) + 60; // Random size between 60px and 160px
}

// Updated random animation duration (between 6 and 10 seconds)
function generateRandomDuration() {
  return 6 + Math.random() * 4; // Random duration between 6 and 10 seconds
}

function PulsatingButton({ text, name, size, position }) {
    const [isHovered, setIsHovered] = useState(false);

    return (
      <motion.button
        style={{
          position: 'absolute',
          top: position.top,
          left: position.left,
          width: size,
          height: size,
          borderRadius: '50%',
          color: 'white',
          fontSize: '16px',
          fontWeight: 'bold',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          border: 'none',
          cursor: 'pointer',
          outline: 'none',
          backgroundColor: isHovered ? '#005f9e' : '#3498db', // Darken color on hover
        }}
        animate={{
          scale: isHovered ? 1.15 : 1, // Increase scale when hovered, revert when not
          x: [0, generateRandomWiggle(), generateRandomWiggle(), generateRandomWiggle(), 0],
          y: [0, generateRandomWiggle(), generateRandomWiggle(), generateRandomWiggle(), 0],
        }}
        transition={{
          duration: 6, // Duration for the entire wiggle animation loop
          ease: 'easeInOut',
          repeat: Infinity, // Repeat the wiggle indefinitely
          repeatType: 'loop',
        }}
        onHoverStart={() => setIsHovered(true)}
        onHoverEnd={() => setIsHovered(false)}
        onClick={() => alert(`${name} clicked!`)}
      >
        {text}
      </motion.button>
    );
  }

  // Function to generate random wiggle values between -5 and 5 pixels




const Hero = () => {
  const [circles, setCircles] = useState([]); // Array of circles

  // Randomly determine how many circles per row between 3 and 4
  const getCirclesPerRow = () => {
    return Math.floor(Math.random() * (4 - 3 + 1)) + 3; // Random number between 3 and 4
  };

  // Function to add one more circle to the page
  const addCircle = () => {
    const circleName = prompt('Name your group', 'Circle ' + (circles.length + 1));
    if (circleName) {
      const randomSize = generateRandomSize();
      const position = generateRandomPositionInBox(circles, randomSize);
      setCircles(prevCircles => [
        ...prevCircles,
        { id: prevCircles.length + 1, name: circleName, size: randomSize, ...position },
      ]);
    }
  };

  // Split circles into rows with random circle count per row
  const getRows = () => {
    let rows = [];
    let circlesCopy = [...circles];
    while (circlesCopy.length > 0) {
      const circlesInRow = getCirclesPerRow();
      const rowCircles = circlesCopy.splice(0, circlesInRow);
      rows.push(rowCircles);
    }
    return rows;
  };

  const rows = getRows(); // Get the rows with random circle count per row

  return (
    <section style={{ width: '100%', padding: 0, margin: 0 }}>
      <div
        style={{
          display: 'flex',
          flexDirection: 'column',
          alignItems: 'center',
          width: '100%',
        }}
      >
        {/* Create rows of circles */}
        {rows.map((row, rowIndex) => (
          <div
            key={rowIndex}
            style={{
              display: 'flex',
              justifyContent: 'center',
              gap: 20,
              width: '100%',
            }}
          >
            {/* Create circles in this row */}
            {row.map((circle) => (
              <div
                key={circle.id}
                style={{
                  position: 'relative',
                  width: BOX_WIDTH,
                  height: BOX_HEIGHT,
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                }}
              >
                <PulsatingButton text={circle.name} name={circle.name} size={circle.size} position={{ top: circle.top, left: circle.left }} />
              </div>
            ))}
          </div>
        ))}
      </div>

      <div style={{ display: 'flex', justifyContent: 'center', marginTop: '20px' }}>
        <button
          onClick={addCircle}
          style={{
            padding: '10px 20px',
            fontSize: '16px',
            backgroundColor: '#3498db',
            color: 'white',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
          }}
        >
          Add Circle
        </button>
      </div>
    </section>
  );
};

const Home = () => {
  return <Hero />;
};

export default Home;
